description:
Data was collected from Cockburn Sound to determine:
- the past and present distribution of seagrasses;
- the 'standing crop' (weight of above-ground material) of seagrass in December 1977;
- the light penetration or attenuation in the water column in Cockburn Sound;
- the suitability of water quality for seagrass growth through the use of field transplants of seagrass; and
- the primary productivity of Posidonia spp. in Cockburn Sound
